import Header from "../component/header";
import swal from 'sweetalert';


function leafletmap() {
    
  function opensweetalert()
  {
    swal("Hello world!");
  }

  return (
    <>
    
      <Header></Header>
    
      <p  onClick={opensweetalert}>
        asdasd
      </p>
    
    </>
  );
}

export default leafletmap;
